import React from "react";
import { Fragment } from "react";

import classes from "./nav.module.css";


const Navigation = () => {
  return (
    <Fragment>
      <nav className={classes.list_nav}>
         <button className={classes.list_button}>List</button>
      </nav>

      <nav className={classes.form_nav}>
        <button className={classes.form_button}>Form</button>
      </nav>
    </Fragment>
  );
};

export default Navigation;
